    true,nt"url": null,nt"notes": "The National Weather Service (NWS) maintains
    historical Eastern Pacific Ocean hurricane weather data in a format that can be
    exploited by Graphic Information System (GIS) software. Using KML/KMZ formats, it
    takes the numbers and words from the rows and columns in databases and spreadsheets
    and puts them on a map.  This data file contains information about named and unnamed
    Eastern Pacific Ocean tropical storms and hurricanes from 1949 to 2006.  Once downloaded,
    the file can be decompiled by decade and by year in a a KML/KMZ GIS viewer.",nt"license_title":
